import React from 'react';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';



function Home() {
    return (
        <Grid
            container
            flexDirection="row"
            justifyContent="space-around"
        >
            <Grid item>
                <Typography>
                    Hi, I'm Charlie.
                </Typography>
                <Typography
                    sx={{
                        fontFamily: "Abel",
                        fontSize: "32px",
                        lineHeight: "48px",
                        fontWeight: "900",
                        textAlign: "center"
                    }}
                >
                    Charlie
                </Typography>
                <Typography>
                    I'm a graduate student at Georgia Tech pursuing an M.S. in Computer Science. I have a B.S. in Biomedical Engineering from Ohio State and am an experience Product Design Engineer and Product Manager.
                </Typography>
            </Grid>
            <Grid item>Also Home</Grid>
        </Grid>
    );
}

export default Home;
